import styled from 'styled-components'

export const StarRatingContainer = styled.div`
  padding-left: 1rem;
  display: inline-block;
  align-items: center;
  padding: 0.5rem 1rem;
  cursor: pointer;
  &:active {
    background-color: #ebebeb;
    border-radius: 1rem;
  }
  svg {
    width: 1.4rem;
    margin-right: 5px;
  }
`
